import React from 'react';

function ProgrammingCalendar({ date }) {
  // Lógica para generar el calendario y mostrar las personas programadas irá aquí.
  // Por ahora, solo mostramos un marcador de posición.

  return (
    <div className="programming-calendar">
      <p>Work in Progress: Calendario para {date.toLocaleString('es-ES', { month: 'long', year: 'numeric' })}</p>
    </div>
  );
}

export default ProgrammingCalendar;
